import React from "react";
import "./NavBar.css";
import { NavLink } from "react-router-dom";
import { Navbar, Nav, NavItem } from "reactstrap";

function NavBar() {
  return (
    <div>
      <Navbar expand="md" light>
        {/* “end” replaces v5’s exact on the root link */}
        <NavLink to="/" end className="navbar-brand">
          Snack or Booze
        </NavLink>

        <Nav className="ml-auto" navbar>
          <NavItem>
            <NavLink
              to="/snacks"
              className={({ isActive }) =>
                "nav-link" + (isActive ? " active" : "")
              }
            >
              Snacks
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink
              to="/drinks"
              className={({ isActive }) =>
                "nav-link" + (isActive ? " active" : "")
              }
            >
              Drinks
            </NavLink>
          </NavItem>
        </Nav>
      </Navbar>
    </div>
  );
}

export default NavBar;
